const {Abieos} = require("@eosrio/node-abieos");

const abieos = Abieos.getInstance();

// Base ABI = no tables
try {
    abieos.loadAbiHex("eosio","");
    console.log(abieos.getTypeForTable("eosio","voters"));
} catch (e) {
    console.log(e.message);
}

// 2nd ABI = abihash only
try {
    abieos.loadAbiHex("eosio","");
    console.log(abieos.getTypeForTable("eosio","abihash"));
} catch (e) {
    console.log(e.message);
}

// 3nd ABI = std system
try {
    abieos.loadAbiHex("eosio","");
    console.log(abieos.getTypeForTable("eosio","voters"));
} catch (e) {
    console.log(e.message);
}

